def check_proxy():
    s = requests.Session()
    s.headers = {
        'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36'
    }
    s.timeout = 3
    realIP = s.get('https://moozik.cn/ip.php').text
    while True:
        site = input()
        if 'exit' in site:
            break
        s.proxies = {
            'https': site,
            'http': site
        }
        ret = ''
        try:
            pp = s.get('https://www.amazon.com/')
            if pp.status_code == 200:
                ret += '可用;'
            else:
                ret += '不可用;'
            pp = s.get('https://moozik.cn/ip.php')
            if pp.text == realIP:
                ret += '匿名;'
            else:
                ret += '透明;'
        except:
            ret += '!异常;'
        print(ret)
